.signup-container {
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
  background-color: #F9F7F4;
}

.signup-box {
  background-color: white;
  padding: 2rem 2rem;
  border-radius: 12px;
  box-shadow: 0 0 12px rgba(0, 0, 0, 0.08);
  width: 100%;
  max-width: 470px;
  text-align: center;
  margin-top: 10%;
}

.signup-title {
  font-size: 30px;
  font-weight: 700;
  color: #E0722D;
  margin-bottom: 8px;
}

.signup-subtitle {
  color: #78736b;
  font-size: 14px;
  word-spacing: 1px;
  margin-bottom: 24px;
}

.signup-label {
  font-weight: 500;
  display: block;
  text-align: left;
  margin-bottom: 6px;
  color: #222;
  font-size: 14px;
  font-weight: bolder;
}

.input-group {
  display: flex;
  align-items: center;
  background-color: #f2f2f2;
  border-radius: 6px;
  padding: 0.5rem 0.75rem;
  margin-bottom: 20px;
}

.phone-icon {
  margin-right: 10px;
  font-size: 18px;
}

.signup-input {
  border: none;
  outline: none;
  background: transparent;
  flex: 1;
  font-size: 15px;
}

.signup-button {
  background-color: #DA752B;
  color: white;
  padding: 0.7rem;
  width: 100%;
  border: none;
  border-radius: 6px;
  font-size: 14px;
  font-weight: bold;
  cursor: pointer;
  transition: 0.3s ease;
}

.signup-button:hover {
  background-color: #a2380c;
}

.signup-login {
  margin-top: 16px;
  font-size: 14px;
  color: #78736b;
}

.signin-link {
  color: #ed8b56;
  cursor: pointer;
  font-weight: 500;
}
